var schemaObject = require('../node-schema-object/lib/schemaobject');
var type_string = {type: String};

var sample = new schemaObject({
"_array": {type: Array, arrayType: String},
"hi": String,
"hello": String,
});

var _ext_sample = new schemaObject({
"_sample": sample,
})

var dev = new _ext_sample({
  "_sample": {
    "hi": "123",
    "hello": "456",
    "_array": ["1", "2", "3"]
  }
});
console.log(dev.getErrors());
console.log(dev._sample);
console.log(dev.toObject());